import React from "react";
import MarkdownEditor from "./MarkdownEditor";
class App extends React.Component {
    constructor(props) {
        super(props);
        this.props = props;
        this.props.type = string;
    }
    render() {
        return (
            <React.StrictMode>
                <h1>Markdown Editor (React JSX)</h1>
                <MarkdownEditor />
            </React.StrictMode>
        );
    }
}
export default App;
